import styled from "styled-components"
const Nombre = styled.h2 `
   color: red;
`

export default function Card({onClose, name, status, species, gender, origin, image}) {
   return (
      <div>
         <button onClick={onClose}>X</button>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin.name}</h2>
         <img src={image} alt={name}/>
      </div>
   );
}
